    if (weakMap.has(endPoint)){
	const number = weakMap.get(endPoint);
	if(number >= 5) throw new Error("Endpoint load is high");
	weakMap.set(endPoint, weakMap.get(endPoint) + 1);
    }
    else {
	weakMap.set(endPoint, 1);
    }
}
